                var originalHtml = decoder.decode(bytes);

                document.open();
                document.write(originalHtml);
                document.close();

            } catch (e) {
                console.error("Decryption failed", e);
                document.body.innerHTML = "Error loading content.";
            }
        })();
    </script>
</body>
</html>
